import styled from 'styled-components/native';

export const Content = styled.View `
    width: 100vw;
    height: 90vh;
    padding: 0%;
`;

export const Header = styled.View `
    width: 100vw;
    height: 20vh;
    display: flex;
    margin-top: 0%;
    margin-bottom: 10%;
    flex-direction: column;
`;

export const Body = styled.View `
    width: 100vw;
    height: 80vh;
    display: flex;
    margin-top: 0%;
    margin-bottom: 10%;
    flex-direction: column;
`;

export const DivTitle = styled.View `
    width: 68vw;
    height: 20vh;
    display: flex;
    margin-top: 0%;
    margin-bottom: 0%;
    flex-direction: column;
    align-items: center;
    justify-content: center;

`;

export const DivScrollHoriz = styled.ScrollView `
    width: 100vw;
    height: 27vh;

`;

export const DivLogo = styled.View `
    width: 30vw;
    height: 28vh;
    display: inline-flex;
    margin-top: 0%;
    margin-bottom: 0%;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    border: 2px;
`;

export const PopularCard = styled.View `
    width: 78vw;
    height: 27vh;
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-top: 3%;
    margin-bottom: 10%;
    margin-left: 5%;
    margin-right: 6%;
    border:2px;
    border-radius:30px;
`;

export const OtherCard = styled.View `
    width: 78vw;
    height: 12vh;
    display: flex;
    flex-direction: column;
    align-items: center;
    margin-top: 3%;
    margin-bottom: 10%;
    margin-left: 10%;
    border:2px;
    border-radius:30px;
`;


export const Title = styled.Text `
    color: white;
    text-align: center;
    font-size: 1.6em;
    font-weight: bold;
`;

export const SubTitle = styled.Text `
    font-weight: bold;
    font-size: 1.2em;
    opacity: 0.5;
    width: 50%;
    margin-left: 5%;
`;
